import mainBox from "./main"
import mainSubBox from "./subMain"
import tabs from "./tabs"
import getPageTitle from '@/utils/getPageName'
import { queryManufacturers } from "@/api/project/iot/IOT/em"
export default {
    name: "projectCenter",
    components: { mainBox, mainSubBox, tabs },
    created () {
        this.$store.dispatch('iotDict/getDicData', ['iot_state_device', 'iot_project_type', 'iot_state'])
        this.getTeam()
    },
    data () {
        return {
            pages: 'main',
            code: undefined,
            row: undefined,
            title: getPageTitle(this.$route.name),
            manufacturersList: null
        }
    },
    methods: {
        setPage (val) {
            this.pages = val
        },
        setCode (val) {
            this.code = val
        },
        setRow (val) {
            this.row = val
        },
        getTeam () {
            queryManufacturers().then(res => {
                this.manufacturersList = res.data.list
            })
        },
    }
};
